import React from "react";
// nodejs library that concatenates classes
import classNames from "classnames";
//nodejs library to set properties for components
import PropTypes from "prop-types";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";

import LinearProgress from '@material-ui/core/LinearProgress';

import linierProgressStyle from "assets/jss/material-kit-react/components/linierProgressStyle.jsx";

const LinearIndeterminate = ({...props}) => {
	const { classes } = props;
	return(
		<div className={classes.linierpg}>
	      <LinearProgress />
	      <br />
	      <LinearProgress color="secondary" />
	    </div>
	);
};

LinearIndeterminate.propTypes = {
	classes : PropTypes.object.isRequired
};

export default withStyles(linierProgressStyle)(LinearIndeterminate)
